import React from 'react';
import '../styles/ProfileHeader.css';

function ProfileHeader({ patientId }) {
    // Assume we have fetched the profile using patientId.
    // Profile data is being passed as a prop
    return (
        <div className="profile-header">
            <h1>John Doe</h1>
            <p>Email: johndoe@example.com</p>
            <p>Age: 29</p>
            <p>Gender: Male</p>
            <p>Height: 180 cm</p>
            <p>Weight: 75 kg</p>
        </div>
    );
}

export default ProfileHeader;
